import React from 'react';
import Header from './header'
import Slider from './slider'
import About from './about'
import Service from './service'
import Client from './client'
import Team from './team'

const Main = () => {
  return ( 
<div>
  <Header/>
  <Slider/>
  <About/>
  <Service/>
  <Client/>
  <Team/>

</div>

   );
}
 
export default Main;
